  "in_reply_to_status_id_str" : "174522740265590785",
  "geo" : {
  },
  "id_str" : "174523443767803904",
  "in_reply_to_user_id" : 15037872,
  "text" : "@wand125 もし「フィクションに登場する物質や装置の概念は共有されてる部分」をまとめた信頼できる情報源が複数あって、それをもとに記事が書けそうなら[[フィクションにおける物質]]みたいな記事を、一覧でなく解説として書いてくださることは歓迎します！ #jawp",
  "id" : 174523443767803904,
